import { BrowserRouter,Routes, Route } from "react-router-dom";
import "./App.css";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Routes>
        <Route path="/" element={<h1>Home</h1>} />
        <Route path="about" element={<h1>Abo</h1>} />
        <Route path="/" element={<h1>Home</h1>} />

        </Routes>
      </div>
      ;
    </BrowserRouter>
  );
}

export default App;
